description:
David O'Doherty is not only funny because he's Irish, not only because of his great hair and not only because of his easily caricatured face but also because he can bash out a tune on a synthesizer like an autistic 10 year-old with a sense of humour who's not really fussed about having a routine in his life and buys his undies from Target :D

THE MODEST ADVENTURES OF DAVID O'DOHERTY is David's very own TV series from 2007. Unfortunately there's only one series consisting of six episodes but never fear, David has gone off on a tangent (as is his want) and made an enviable comedy career for himself all around the globe. He also won a Perrier Award... which is fancier than it sounds :p This download contains all 6 episodes PLUS &quot;My Beefs 2009-2012&quot;. You're welcome :)

